import PhotoEncoder from "./photo-encoder.js";
class JPEGEncoder extends PhotoEncoder {
    constructor(settings) {
        super(settings);
        this.mimeType = 'image/jpeg';
        this.extension = '.jpg';
    }
}
export default JPEGEncoder;
